        function returndirectory($dirname="") {
            $pattern='~\b(yii-1.1.17|.DS_Store)\b~i';
            $files = array();
            $comma = '';
            if($handle = opendir($dirname)) {
                while(false !== ($file = readdir($handle))){
                    if( !in_array($file, array('.', '..', '.htaccess', 'index.php')) ){ //if this file is a valid image
                        //Output it as a JavaScript array element
                        echo $comma . '"'. $file . '"';
                        $comma = ',';
                    }
                }
                closedir($handle);
            }
            return($files);
        }

        function listContent() {
            echo 'var directoryarray=['; //Define array in JavaScript
            returndirectory(getcwd()); //Output the array elements containing the image file $
            echo '];';
            flush();
        }

