        function getMetarContents($file="") {
            $timeout = 0.3;
            $contents = @file_get_contents($file, false, stream_context_create( array( 'http'=>array( 'timeout' => $timeout, ) )));
            return ($contents ? preg_replace( "/\r|\n/", " ", $contents ) : 'Could Not Load From ['.$file.'] Within '.$timeout.'s');
        }

        echo 'var weatherReport="' . getMetarContents('http://tgftp.nws.noaa.gov/data/observations/metar/stations/KMSP.TXT') . '";';

        ?>

        function populateList(list, targetList, replaceString) {
            var directoryList = document.getElementById(targetList);

            for(var i=0; i<list.length; i++) {
                var directoryName = list[i];
                var li = document.createElement("li");
                var a = document.createElement("a");
                a.setAttribute('href', directoryName);
                //a.setAttribute('target', "_blank");
                a.appendChild(document.createTextNode(directoryName.replace(replaceString, "")));

                li.appendChild(a);
                directoryList.appendChild(li);
            }
        }

        function resizePHPInfo() {
            if(document.getElementsByClassName("center")[0].style.maxHeight == "100000px") {
                document.getElementsByClassName("center")[0].removeAttribute("style");
            } else {
                document.getElementsByClassName("center")[0].style.maxHeight = "100000px";
            }
        }

        function defineEventsClick() {
            document.getElementsByClassName("center")[0].ondblclick = resizePHPInfo;
        }

        function GetClock(){
            tday=new Array("Sunday","Monday","Tuesday","Wednesday","Thursday","Friday","Saturday");
            tmonth=new Array("January","February","March","April","May","June","July","August","September","October","November","December");
            var d=new Date();
            var nday=d.getDay(),nmonth=d.getMonth(),ndate=d.getDate(),nyear=d.getYear();
            if(nyear<1000) nyear+=1900;
            var nhour=d.getHours(),nmin=d.getMinutes(),nsec=d.getSeconds();
            if(nmin<=9) nmin="0"+nmin
            if(nsec<=9) nsec="0"+nsec;

            document.getElementById('clockbox').innerHTML=""+tday[nday]+", "+ndate+" "+tmonth[nmonth]+" "+nyear+" "+nhour+":"+nmin+":"+nsec+"";
        }

        window.onload = function() {
            populateList(directoryarray, "directoryList", "");
            GetClock();
            setInterval(GetClock,1000);
            document.getElementById("weather").innerHTML = weatherReport;
        }

    </script>

